import React from 'react';
import {Card, Tabs, Button} from "antd";

const TabPane = Tabs.TabPane;

const Dashboard = () => {
	const callback = (key) => {
	};

	return (
		<div style={{}}>
		{/* <Card className="gx-card" title="Basic"> */}
			<div>
			<h1 className='gx-font-weight-semi-bold' style={{fontSize: "30px"}}>Lorem ipsum dolor</h1>
			<div style={{    width: "33%",marginTop: "20px"}}>
				<Button className="gx-mb-0 design-button" style={{background: "#fff", border: "1px solid #C2C2C2", width: "40%"}} htmlType="button">
					+ Lorem ipsum
				</Button>
				<Button className="gx-mb-0 design-button" style={{background: "#D3F36B", border: "1px solid #C2C2C2", width: "40%"}} htmlType="button">
					+ Lorem ipsum
				</Button>
			</div>	
		</div>
			<Tabs defaultActiveKey="1" onChange={callback}>
				<TabPane tab="Lorem" key="1"></TabPane>
				<TabPane tab="Ipsum" key="2"></TabPane>
				<TabPane tab="Dolor" key="3"></TabPane>
			</Tabs>
			<span>serach</span>
		{/* </Card> */}
		</div>
	);
};

export default Dashboard;
